def maxNestingLevel(html):
    stack = []
    count = 1
    i = 0
    while i < len(html):
        if html[i] == '<':
            if html[i + 1] != '/':
                stack.append(html[i:i + html[i:].index('>') + 1])
            else:
                stack.pop()
                count = max(count, len(stack))
        i += 1
    return count

